"use strict";var MIM={init:function(){MIM.makeLandingFullHeight(),MIM.triggerPreloader(),MIM.triggerScrollUp(),MIM.showScrollUp()},makeLandingFullHeight:function(){var o=$(".landing"),t=$(".navbar"),n=$(window).height(),r=o.outerHeight(!0),i=t.outerHeight(!0),l=n-(r+i);o.css({paddingBottom:l})},triggerPreloader:function(){$(window).load(function(){var o=$("#preloader"),t=$(".preloader");o.delay(500).fadeOut(),t.delay(600).fadeOut("slow")})},showScrollUp:function(){$(window).scroll(function(){$(".scroll-up").css($(this).scrollTop()>1?{bottom:"25px"}:{bottom:"-100px"})})},triggerScrollUp:function(){$(".scroll-up").click(function(){return $("html, body").animate({scrollTop:"0px"},800),!1})}};$(document).on("ready",function(){MIM.init()});